import React, { Component } from "react";
import BlockPreview from "../components/BlockPreview";
import {Container, Row, Col} from "../components/Grid";



class BrowsePage extends Component {
    render() {
        return (
            <>
            <Container fluid>
                <Row>
                    <BlockPreview title={"Last Night I Went"} previewtext={"It never occured to Ethan that staying up all night would lead to his demise. He was so sick to his stomach the next day."} wordcount={25} contributorcount={1} />
                    <BlockPreview title={"If Ever in Trouble"} previewtext={"Carlos just did it!"} wordcount={4} contributorcount={1} />
                    <BlockPreview title={"Strawberry and Mail"} previewtext={"Two things you never thought would be in the same sentence"} wordcount={25} contributorcount={1} />
                    <BlockPreview title={"Last Night I Went"} previewtext={"It never occured to Ethan that staying up all night would lead to his demise. He was so sick to his stomach the next day."} wordcount={25} contributorcount={1} />
                    <BlockPreview title={"Last Night I Went"} previewtext={"It never occured to Ethan that staying up all night would lead to his demise. He was so sick to his stomach the next day."} wordcount={25} contributorcount={1} />
                </Row>

            
            </Container>
            </>
        )
    }
}

export default BrowsePage;
